import React from "react";
import { Document } from "react-pdf";
import resume from "../images/Resume.pdf";

function Resume() {
    return (
        <div>
            <iframe src={resume}
                style={{ position: "absolute",
                     //top: "100",
                     left: "0",
                     bottom: "0",
                     right: "0",
                     width: "100%",
                    height: "100%"
                   }}>
            </iframe>
        </div>


    );
}

export default Resume;
